import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class TestService {

  constructor() { }

  getTestname(){
    return 'Ankita';
  }

  getEmployees(){
    return[
      {"id": 1, "name" : "Ankita", "age": 26},
      {"id": 2, "name" : "Pranita", "age": 25},
      {"id": 3, "name" : "Aishwarya", "age": 27}
    ]
  }
}
